      type='plain'>mp3:http://bit.ly/oRYyiV - A musical celebration of the importance
      and inspirational qualities of space exploration (human and robotic), as well
      as a look at some of the amazing worlds in our solar system.  Featuring Neil
      deGrasse Tyson, Brian Cox, and Carolyn Porco.  \n\n\"Onward to the Edge\" is
      the 12th installment in the Symphony of Science series.  Materials used in this
      video are from :\n\nMy Favorite Universe #7 - Onward to the Edge (http://www.youtube.com/watch?v=LEYoTwFBqFs)\nBBC
      Wonders of the Solar System\nCarolyn Porco TED talk (http://www.youtube.com/watch?v=xxXa9pxwzoY)\nNatGeo
      \"Guide to the Planets\"\n\nThanks for watching!\n\nLyrics:\n\n[Neil deGrasse
      Tyson]\nThe act of moving onward means we pass these sign posts\nOne of them
      was first leaving earth\nThe next one is hanging out on the moon\nWhat's next?
      The planets\n\nOnward to the edge\nWe're moving onward to the edge\nHere we
      are together\nThis fragile little world\n\n[Brian Cox]\nThis is our sun\nJust
      another star in a sea of stars\nThe heart of the solar system\nJust another
      star in a sea of stars\n\nMercury is the closest planet\nThis tortured piece
      of rock has been stripped naked\n\n[Tyson]\nThe moon has a sky\nIt has a horizon\nIt's
      another world\n\nIt's got earth in the sky \nJust the way we have the moon in
      the sky\n\n(refrain)\n\nWe're not the only world to think about\nWorlds unnumbered\nWe're
      not the only world to think about\nThink about worlds unnumbered\n\n[Carolyn
      Porco]\nThere is a powerful recognition \nThat stirs within us\nWhen we see
      our own little blue ocean planet\nIn the skies of other worlds\n\nThe Saturn
      system\nOffers splendor beyond compare\nBecause of its rings\nAnd very diverse
      moons\n\n[Tyson]\nThese are no longer abstractions\nThese are worlds\nMaybe
      there's life there\nThey've changed how we think about Earth\n\n[Cox]\n\"A mote
      of dust suspended in a sunbeam\nThe pale blue dot\" (Carl Sagan)\n\n(refrain)\n\nThe
      laws of nature create\nVastly different worlds\nWith the tiniest of changes\n\n[Tyson]\nWhen
      I reach to the edge of the universe\nI do so knowing that along some paths of
      cosmic discovery\nThere are times when, at least for now,\nOne must be content
      to love the questions themselves</media:description><media:keywords>symphony,
